css:
@-moz-document
	url-prefix('http://www.tumblr.com/'),
	url-prefix('https://www.tumblr.com/')
{

.new_post_label/*_icon*/ > I {display: none !important}
.new_post_buttons {
  background: white center no-repeat url('data:image/png;base64,') !important;
}
.new_post_label:hover {
/*  padding: 39px 1px 40px 0 !important;*/
  color:#000 !important;
  background-color: rgba(41,199,0,.7) !important;
}

.new_post_label{
  font-size:14px !important;
  padding:10px 1px 69px 0 !important;
  font-family:Georgia, Times New Roman, sans-serif !important;
  font-style:italic !important;
  text-transform: lowercase !important;
  color:#222 !important;
  letter-spacing:1px !important;
  background-clip: content-box;
}

}
